import itertools

# operands and operators in order
operands = [2, 3, 4, 5, 1]
operators = ['*', '*', '*', '+']

from functools import lru_cache

@lru_cache(None)
def eval_segment(i, j):
    """Return set of possible values for operands[i:j+1] with operators[i:j]"""
    if i == j:
        return {operands[i]}
    results = set()
    # split at each operator position k (i <= k < j)
    for k in range(i, j):
        left_vals = eval_segment(i, k)
        right_vals = eval_segment(k+1, j)
        op = operators[k]
        for a in left_vals:
            for b in right_vals:
                if op == '*':
                    results.add(a * b)
                elif op == '+':
                    results.add(a + b)
    return results

all_vals = eval_segment(0, len(operands)-1)
print(len(all_vals))
print(sorted(all_vals))

