def find_min_multiple():
    q = collections.deque(['2'])
    while q:
        s = q.popleft()
        # Append next digits
        for nxt in ('0', '2'):
            ns = s + nxt
            # avoid leading zeros automatically handled
            if ns[-1] == '0':
                n = int(ns)
                if n % 30 == 0:
                    return n
                q.append(ns)
