def sum_proper_divisors(n):
    if n <= 1:
        return 0
    total = 1
    p = 2
    while p * p <= n:
        if n % p == 0:
            q = n // p
            total += p
            if q != p:
                total += q
        p += 1 if p == 2 else 2
    return total

