import itertools

people = ['P','R','T','A','B','C','D']  # Pierre, Rosa, Thomas, others
def canonical(arr):
    # rotate so that the smallest tuple (lexicographically) among rotations is the representative
    n = len(arr)
    rotations = [tuple(arr[i:]+arr[:i]) for i in range(n)]
    return min(rotations)

