import sympy as sp

def count_k():
    cnt = 0
    for k in range(-500, 501):
        if k == 0:
            continue
        x = sp.symbols('x', real=True)
        # equation log(k*x) = 2*log(x+2)
        # Convert to algebraic equation with domain conditions
        eq = sp.Eq(k*x, (x+2)**2)
        sols = sp.solve(eq, x)
        # Filter real solutions satisfying domain
        real_sols = []
        for sol in sols:
            if sol.is_real:
                if sol > -2 and k*sol > 0:
                    real_sols.append(sol)
        # Count distinct solutions
        if len(set(real_sols)) == 1:
            cnt += 1
    return cnt

print(count_k())

